# â”€â”€ CellÂ 3.5 Â· patch FFTStyleConditioner (autoâ€‘tiling fix, optional verbose) â”€â”€
import torch, torch.nn as nn
from fft_style_conditioner import FFTStyleConditioner

# ---------------------------------------------------------------------------
# Flip this flag when you actually need to inspect what the conditioner does
# ---------------------------------------------------------------------------
DBG_FFT = False            # â† True  = verbose tensor dump
                           # â† False = completely silent  (default)

# ---------- prettyâ€‘printing helper (used only when DBG_FFT=True) ------------
def _dbg_stats(t):
    t32 = t.float()
    return (f"sh={tuple(t.shape)} "
            f"min={t32.min():+.3e} max={t32.max():+.3e} "
            f"mean={t32.mean():+.3e} std={t32.std():+.3e} "
            f"finite={torch.isfinite(t32).all().item()}")

# ---------- SILENT forward with the tiling bug fixed ------------------------
def _fixed_forward(self, content, style, *, _eps=1e-6):
    c, s = content.float(), style.float()

    # spectra Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­
    Cf, Sf = torch.fft.rfftn(c, dim=(-2, -1)), torch.fft.rfftn(s, dim=(-2, -1))
    Cm, Sm = torch.abs(Cf).clamp_min(_eps), torch.abs(Sf).clamp_min(_eps)
    R      = torch.log(Sm) - torch.log(Cm)
    mu     = R.mean(dim=(-2, -1), keepdim=True)
    sd     = R.std (dim=(-2, -1), keepdim=True, unbiased=False)
    Rn     = (R - mu) / (sd + _eps)

    # collapse RGB, then tile to match the first conv's channel count Â­Â­Â­Â­
    x = Rn.mean(dim=1, keepdim=True)                    # (B,1,H,Wspec)

    seq = next((m for m in self._modules.values()
                if isinstance(m, nn.Sequential)), None)
    first_conv = seq[0] if seq and isinstance(seq[0], nn.Conv2d) \
                     else next(m for m in self.modules() if isinstance(m, nn.Conv2d))
    need_C = first_conv.in_channels
    if x.shape[1] != need_C:
        reps = need_C // x.shape[1]
        if need_C % x.shape[1] != 0:
            raise RuntimeError(f"Cannot tile {x.shape[1]}â†’{need_C} channels cleanly")
        x = x.repeat(1, reps, 1, 1)

    # pass through the conv stack Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­Â­
    if seq is None:
        for m in self._modules.values():
            x = m(x)
    else:
        for layer in seq:
            x = layer(x)
    return x                                             # stay fp32 for safety

# ---------- VERBOSE forward (wraps the same math with prints) ---------------
def _debug_forward(self, content, style, *, _eps=1e-6):
    print("\nâ–¶ï¸  FFTStyleConditioner.forward()  â—€ï¸")
    step = 0
    def p(tag, tensor):
        nonlocal step
        step += 1
        print(f"  [{step:02d}] {tag:18s}", _dbg_stats(tensor))
    # identical math as _fixed_forward, just sprinkled with p(...)
    c, s = content.float(), style.float()
    p("content in", c); p("style in", s)

    Cf, Sf = torch.fft.rfftn(c, dim=(-2, -1)), torch.fft.rfftn(s, dim=(-2, -1))
    Cm, Sm = torch.abs(Cf).clamp_min(_eps), torch.abs(Sf).clamp_min(_eps)
    p("C mag", Cm); p("S mag", Sm)

    Cl, Sl = torch.log(Cm), torch.log(Sm)
    p("C log", Cl); p("S log", Sl)

    R  = Sl - Cl
    p("spectral res", R)

    mu = R.mean(dim=(-2, -1), keepdim=True)
    sd = R.std (dim=(-2, -1), keepdim=True, unbiased=False)
    Rn = (R - mu) / (sd + _eps)
    p("residual Î¼", mu); p("residual Ïƒ", sd); p("norm resid", Rn)

    x = Rn.mean(dim=1, keepdim=True)
    p("collapse RGB", x)

    seq = next((m for m in self._modules.values()
                if isinstance(m, nn.Sequential)), None)
    first_conv = seq[0] if seq and isinstance(seq[0], nn.Conv2d) \
                     else next(m for m in self.modules() if isinstance(m, nn.Conv2d))
    need_C = first_conv.in_channels
    if x.shape[1] != need_C:
        reps = need_C // x.shape[1]
        x = x.repeat(1, reps, 1, 1)
        p(f"tiled Ã—{reps}", x)

    if seq is None:
        for name, m in self._modules.items():
            x = m(x); p(name, x)
    else:
        for i, layer in enumerate(seq):
            x = layer(x); p(f"proj[{i}]", x)

    return x

# ---------- single router that picks silent or verbose ----------------------
if not hasattr(FFTStyleConditioner, "_orig_forward"):
    FFTStyleConditioner._orig_forward = FFTStyleConditioner.forward  # backup

def _router_forward(self, content, style, **kw):
    if DBG_FFT:
        return _debug_forward(self, content, style, **kw)
    return _fixed_forward(self, content, style, **kw)

FFTStyleConditioner.forward = _router_forward
print("âœ…  FFTStyleConditioner patched (autoâ€‘tiling fix, DBG_FFT =", DBG_FFT, ")")


