# %% [code]
# â”€â”€ Cell 6 Â· helpers + *xformersâ€‘safe* builder â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
import gc, types, warnings, torch
from diffusers import StableDiffusionPipeline
from diffusers.models.attention_processor import AttnProcessor
from fft_style_conditioner import FFTStyleConditioner

# -----------------------------------------------------------------------
def tidy_cuda():
    gc.collect(); torch.cuda.empty_cache(); torch.cuda.ipc_collect()

def _fallback_to_torch_attention(pipe):
    """Replace every attention block with the regular torch implementation."""
    pipe.unet.set_attn_processor({n: AttnProcessor()
                                  for n in pipe.unet.attn_processors})
    print("âœ…  Using plainâ€‘PyTorch attention (xformers disabled)")

# -----------------------------------------------------------------------
def build_style_transfer(model_id="CompVis/stable-diffusion-v1-4",
                         dtype=torch.float16,
                         device_map="balanced"):
    """
    Safe loader that never touches xformers.
      â€¢ lowâ€‘CPU streaming load
      â€¢ weights sharded across devices with `device_map="balanced"`
      â€¢ attention slicing ON
    """
    tidy_cuda()
    print("â³  Loading Stable Diffusionâ€¦")

    pipe = StableDiffusionPipeline.from_pretrained(
        model_id,
        torch_dtype=dtype,
        variant="fp16",
        device_map=device_map,
        low_cpu_mem_usage=True,
        safety_checker=None,
        requires_safety_checker=False,
    )
    print("âœ…  Pipeline loaded")

    # ------- make absolutely sure weâ€™re NOT on xformers -----------------
    _fallback_to_torch_attention(pipe)
    pipe.enable_attention_slicing("auto")

    # â€”â€”â€” wrap into StyleTransferDiffusion without reâ€‘loading weights â€”â€”â€”
    std              = StyleTransferDiffusion.__new__(StyleTransferDiffusion)
    std.pipe, std.unet = pipe, pipe.unet
    std.device        = next(iter(std.unet.parameters())).device
    std.dtype         = dtype
    std.cond          = FFTStyleConditioner().to(std.device, dtype=torch.float32)

    # injection sites â†’ 1Ã—1 adapters
    std.sites = [
        (std.unet.down_blocks[2], std.unet.down_blocks[2].resnets[-1].out_channels),
        (std.unet.down_blocks[3], std.unet.down_blocks[3].resnets[-1].out_channels),
        (std.unet.mid_block,      std.unet.mid_block.resnets[-1].out_channels),
        (std.unet.up_blocks[0],   std.unet.up_blocks[0].resnets[-1].out_channels),
        (std.unet.up_blocks[1],   std.unet.up_blocks[1].resnets[-1].out_channels),
    ]
    std.adapters = torch.nn.ModuleList(
        [torch.nn.Conv2d(512, ch, 1).to(std.device, dtype) for _, ch in std.sites]
    )
    for p in std.unet.parameters():
        p.requires_grad_(False)

    StyleTransferDiffusion._bind_sites(std)
    std._style = None

    print(f"âœ…  StyleTransferDiffusion readyÂ |Â device={std.device}Â |Â dtype={dtype}")
    return std



