# â”€â”€ Cell 12 (REWRITE) â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
def fix_model_dtypes(model, target_dtype=None):
    """
    Force *every* parameter (weight **and** bias) in UNet, adapters,
    text-encoder and VAE to the same dtype.
    """
    if target_dtype is None:
        target_dtype = model.dtype          # default: fp16 on GPU, fp32 on CPU

    def _cast_module(mod):
        if hasattr(mod, "weight") and mod.weight is not None:
            mod.weight.data = mod.weight.data.to(target_dtype)
        if hasattr(mod, "bias") and mod.bias is not None:
            mod.bias.data = mod.bias.data.to(target_dtype)

    # 1ï¸âƒ£ UNet
    for m in model.unet.modules():
        _cast_module(m)

    # 2ï¸âƒ£ adapters
    for i, adpt in enumerate(model.adapters):
        model.adapters[i] = adpt.to(model.device, target_dtype)
        _cast_module(model.adapters[i])

    # 3ï¸âƒ£ text-encoder
    for m in model.pipe.text_encoder.modules():
        _cast_module(m)

    # 4ï¸âƒ£ VAE
    for m in model.pipe.vae.modules():
        _cast_module(m)

    print(f"âœ… All model parameters are now {target_dtype}")
    return model


# run once, right here â¤µ
model = fix_model_dtypes(model)      # â†© everything becomes fp16


