# â”€â”€ Cell 13 (REWRITE) â€“ safe warm-up loop â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
from diffusers import DDPMScheduler
import torch, torch.nn.functional as F, torch.nn as nn

device  = model.device
fp16    = torch.float16        # what SD runs in
fp32    = torch.float32        # what weâ€™ll compute loss in
scale   = 0.05                 # residual scaling for FFT map
steps   = 200                  # warm-up iterations

# Leave UNet in fp16; cast ONLY the learnable parts to fp32 for stability
model.cond       = model.cond.to(device, dtype=fp32)
model.adapters   = torch.nn.ModuleList([adpt.to(device, dtype=fp32)
                                        for adpt in model.adapters])

# option 1 â€“ convert to lists then concatenate
optim_params = list(model.cond.parameters()) + list(model.adapters.parameters())
optim = torch.optim.Adam(optim_params, lr=5e-5)

scheduler = DDPMScheduler(num_train_timesteps=1_000,
                          beta_schedule="squaredcos_cap_v2")

# static latents / empty-prompt embeddings --------------------------------------------------
with torch.no_grad():
    base_lat = model.pipe.vae.encode((content*2-1).to(fp16)).latent_dist.sample()
    base_lat *= model.pipe.vae.config.scaling_factor
    empty_emb = model.pipe.text_encoder(
        model.pipe.tokenizer("", return_tensors="pt").input_ids.to(device)
    )[0]

base_lat_fp32 = base_lat.to(fp32)
empty_emb_fp32 = empty_emb.to(fp32)

print(f"âš™ï¸  warm-up ({steps} iterations) â€¦")
for it in range(steps):
    optim.zero_grad()

    # DDPM noising step --------------------------------------------------------------------
    t        = torch.randint(0, 1_000, (1,), device=device).long()
    noise    = torch.randn_like(base_lat_fp32)
    noisylat = scheduler.add_noise(base_lat_fp32, noise, t)

    # build style map in fp32 --------------------------------------------------------------
    style_map = model.cond(content.to(fp32), style.to(fp32))
    style_map = scale * (style_map / (style_map.std() + 1e-5))

    # temporarily store fp16 copy so patched UNet sees the right dtype
    model._style = style_map.to(fp16)

    # UNet forward (fp16) ------------------------------------------------------------------
    with torch.cuda.amp.autocast(enabled=True, dtype=fp16):
        pred = model.unet(noisylat.to(fp16), t,
                          encoder_hidden_states=empty_emb.to(fp16)).sample

    loss = F.mse_loss(pred.to(fp32), noise)
    loss.backward()
    nn.utils.clip_grad_norm_(model.cond.parameters(), 1.0)
    nn.utils.clip_grad_norm_(model.adapters.parameters(), 1.0)
    optim.step()
    model._style = None          # tidy up

    if it % 50 == 0:
        print(f"  step {it:3d} | loss {loss.item():.6f}")

print("âœ… warm-up finished (no dtype mismatches)")

# OPTIONAL: cast adapters back to fp16 for inference speed
model = fix_model_dtypes(model)


