# â”€â”€ Cell 15 (re-rewrite) Â· dataset & helpers  â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
import random, itertools, pathlib, torch, torchvision
from torch.utils.data import Dataset, DataLoader
from torchvision.transforms import (Compose, Resize, CenterCrop,
                                     Normalize, InterpolationMode)

# helper: drop an alpha channel if present
def drop_alpha(img_tensor):          # img_tensor = (C,H,W) uint8, Câˆˆ{3,4}
    return img_tensor[:3]            # keep only RGB

class StyleTransferPairs(Dataset):
    """
    Returns (content, style) float tensors in **[-1,1]** and exactly
    3 channels.  Images are resized to 384Ã—384 to keep VRAM low.
    Folder layout:
        data_root/
            content/*.jpg|png
            style/<artist>/*.jpg|png
    """
    def __init__(self, data_root, size=384):
        root = pathlib.Path(data_root)
        self.content = sorted((root/"content").rglob("*.[jp][pn]g"))
        self.style   = sorted((root/"style").rglob("*.[jp][pn]g"))

        self.tfm = Compose([
            drop_alpha,                                    # â† NEW
            Resize(size, interpolation=InterpolationMode.BICUBIC),
            CenterCrop(size),
            lambda x: x.float().div(255.),                 # â†’ [0,1]
            Normalize(0.5, 0.5),                          # â†’ [-1,1]
        ])

    def __len__(self):   return len(self.content)

    def __getitem__(self, idx):
        ct = self.tfm(torchvision.io.read_image(str(self.content[idx])))
        st = self.tfm(torchvision.io.read_image(
                 str(random.choice(self.style))))
        return ct, st



