# Cell 16 Â· safe GPU reset & low-VRAM loading helper (fixed device_map & guarded xFormers)
import gc
import torch
import warnings
import types
from diffusers import StableDiffusionPipeline
# Make sure StyleTransferDiffusion and FFTStyleConditioner are defined before this cell

def tidy_cuda():
    """Free every tensor & empty the CUDA caching allocator."""
    gc.collect()
    torch.cuda.empty_cache()
    torch.cuda.ipc_collect()

def build_style_transfer(model_id="CompVis/stable-diffusion-v1-4"):
    """
    Loads SD-1.4 with memory optimizations AND corrects scheduler config mismatch.
      â€¢ low_cpu_mem_usage=True      (streamed load)
      â€¢ device_map="balanced"       (weights spread to fit VRAM)
      â€¢ torch_dtype=torch.float16
    Then enables slicing + xFormers (if available) and wraps in StyleTransferDiffusion.
    """
    tidy_cuda()                           # â‘  flush everything
    print("â³ Loading Stable Diffusion pipeline...")

    pipe = StableDiffusionPipeline.from_pretrained(
        model_id,
        torch_dtype=torch.float16,
        device_map="balanced",            # â† use â€œbalancedâ€ instead of unsupported â€œautoâ€
        low_cpu_mem_usage=True,           # stream from disk
        variant="fp16",
        safety_checker=None,
        requires_safety_checker=False,
    )
    print("âœ… Pipeline loaded.")

    # *** FIX: Check and Correct Scheduler Config ***
    try:
        buffer_len = len(pipe.scheduler.alphas_cumprod)
        config_len = pipe.scheduler.config.num_train_timesteps
        if buffer_len != config_len:
            warnings.warn(
                f"Scheduler config mismatch detected! "
                f"config.num_train_timesteps={config_len}, "
                f"but len(alphas_cumprod)={buffer_len}. "
                f"Forcing config to match buffer length {buffer_len}."
            )
            pipe.scheduler.config.num_train_timesteps = buffer_len
        else:
            print(f"âœ… Scheduler config matches buffer length ({buffer_len}).")
    except Exception as e:
        warnings.warn(f"Error during scheduler config check: {e}")
    # *** END FIX ***

    # Enable xFormers memory-efficient attention (optional)
    try:
        pipe.enable_xformers_memory_efficient_attention()
        print("âœ… xformers attention enabled")
    except Exception:
        # xFormers isnâ€™t critical â€” just warn and move on
        print("âš ï¸ xformers not available or failed to enable.")

    # Always enable attention slicing
    try:
        pipe.enable_attention_slicing("auto")
        print("âœ… Attention slicing enabled.")
    except Exception as e:
        print(f"âš ï¸ Failed to enable attention slicing: {e}")

    # Wrap into our StyleTransferDiffusion class without reloading weights
    print("â³ Wrapping pipeline in StyleTransferDiffusionâ€¦")
    std = StyleTransferDiffusion.__new__(StyleTransferDiffusion)
    std.pipe   = pipe
    std.unet   = pipe.unet

    # Determine primary device (usually cuda)
    try:
        unet_dev = next(iter(std.unet.parameters())).device
        std.device = unet_dev if unet_dev.type != 'meta' else torch.device("cuda" if torch.cuda.is_available() else "cpu")
    except:
        std.device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

    std.dtype  = torch.float16
    std._style = None

    # FFT-based style conditioner
    std.cond = FFTStyleConditioner().to(std.device, dtype=torch.float32)

    # Discover UNet injection sites & build adapters
    std.sites = [
        (std.unet.down_blocks[2], std.unet.down_blocks[2].resnets[-1].out_channels),
        (std.unet.down_blocks[3], std.unet.down_blocks[3].resnets[-1].out_channels),
        (std.unet.mid_block,      std.unet.mid_block.resnets[-1].out_channels),
        (std.unet.up_blocks[0],   std.unet.up_blocks[0].resnets[-1].out_channels),
        (std.unet.up_blocks[1],   std.unet.up_blocks[1].resnets[-1].out_channels),
    ]
    std.adapters = torch.nn.ModuleList(
        [torch.nn.Conv2d(512, ch, 1).to(std.device, std.dtype) for _, ch in std.sites]
    )

    # Freeze UNet & bind adapters
    for p in std.unet.parameters(): p.requires_grad_(False)
    std._bind_sites = types.MethodType(StyleTransferDiffusion._bind_sites, std)
    std._proj       = types.MethodType(StyleTransferDiffusion._proj, std)
    std._bind_sites()
    print("âœ… Adapters created and bound.")

    print(f"âœ… StyleTransferDiffusion ready | Device: {std.device} | Dtype: {std.dtype}")
    return std



