dataset = StyleTransferPairs(data_root="raw_images", size=384)

# â”€â”€ clear any leftover CUDA memory â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
tidy_cuda()

# â”€â”€ hyperâ€parameters & grid â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
sample_ids = [0, 122, 413]                  # three deterministic examples
cfg_vals   = [3, 8]                         # weak vs. strong style push
keep_vals  = [0.60, 0.95, 0.98]             # overwrite â†â†’ preserve
