rows, cols = len(sample_ids), 2 + len(grid)
fig, ax    = plt.subplots(rows, cols, figsize=(cols * 3.0, rows * 4))

# â”€â”€ loop & render â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
for r, idx in enumerate(sample_ids):
    # load a content/style pair
    c_t, s_t = dataset[idx]

    # show content
    ax[r, 0].imshow(to_pil_image((c_t * 0.5 + 0.5)))
    ax[r, 0].set_title("Content")
    ax[r, 0].axis("off")

    # show style
    ax[r, 1].imshow(to_pil_image((s_t * 0.5 + 0.5)))
    ax[r, 1].set_title("Style")
    ax[r, 1].axis("off")

    # sweep through all CFG Ã— keep combinations
    for gidx, (cfg, keep) in enumerate(grid):
        col = 2 + gidx
        seed = 1337 + r * 10 + gidx

        # create a generator for reproducible noise
        gen = torch.Generator(device=model.device).manual_seed(seed)

        with torch.no_grad():
            out = model.generate(
                c_t.unsqueeze(0),
                s_t.unsqueeze(0),
                guidance=cfg,
                keep=keep,
                steps=steps,
                generator=gen
            )[0]

        # out is already a PIL.Image
        ax[r, col].imshow(out)
        ax[r, col].set_title(f"CFG {cfg}\nkeep {keep}", fontsize=8)
        ax[r, col].axis("off")

        tidy_cuda()

# â”€â”€ finalize and show â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
