# %% [code]
# â”€â”€ CellÂ 20 Â· extended fineâ€‘tune (30â€¯epochs, Î±â€‘decay, extra layers) â”€â”€â”€â”€â”€â”€
import os, gc, math, torch, torch.nn as nn, torch.nn.functional as F
from torch.cuda.amp import GradScaler, autocast
from torch.utils.data import DataLoader
from diffusers import DDPMScheduler
from diffusers.models.attention_processor import AttnProcessor

# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
EPOCHS          = 30
BATCH_SIZE      = 4
LR              = 5e-5
STYLE_ALPHA_0   = 0.05          # start value
STYLE_ALPHA_MIN = 0.01          # cosineâ€‘decay floor
GRAD_CLIP_NORM  = 0.5
ckpt_dir        = "checkpoints_long"; os.makedirs(ckpt_dir, exist_ok=True)
device          = torch.device("cuda" if torch.cuda.is_available() else "cpu")
# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€

# 1) build fresh model
model = build_style_transfer()
model = fix_model_dtypes(model)                       # everything fp16

# 2) cast **trainable** layers to fp32
for i, ad in enumerate(model.adapters):
    model.adapters[i] = ad.to(device, torch.float32)

model.unet.down_blocks[3].to(torch.float32)
model.unet.mid_block.to(torch.float32)
print("ğŸŸ¢ also training down_blocks[3] & mid_block (cast to fp32)")

model.cond = model.cond.to(device, torch.float32).eval()
model.unet.set_attn_processor(
    {n: AttnProcessor() for n in model.unet.attn_processors}
)

# 3) optimiser & scheduler
optim_params = (list(model.adapters.parameters()) +
                list(model.unet.down_blocks[3].parameters()) +
                list(model.unet.mid_block.parameters()))
optim  = torch.optim.Adam(optim_params, lr=LR)
sched  = DDPMScheduler(1000, beta_schedule="squaredcos_cap_v2")
scaler = GradScaler()

# 4) detached emptyâ€‘prompt embedding
with torch.no_grad():
    tok_ids   = model.pipe.tokenizer("", return_tensors="pt").input_ids.to(device)
    empty_emb = model.pipe.text_encoder(tok_ids)[0].to(torch.float16).detach()

def _norm(x, eps=1e-3):
    return (x - x.mean()) / (x.std() + eps)

print(f"ğŸ”§ extended training â€“ {EPOCHS}â€¯epochs, batchÂ =Â {BATCH_SIZE} â€¦")

for epoch in range(1, EPOCHS + 1):
    # cosineâ€‘decay STYLE_ALPHA
    p = (epoch - 1) / max(1, EPOCHS - 1)
    style_alpha = STYLE_ALPHA_MIN + 0.5*(STYLE_ALPHA_0 - STYLE_ALPHA_MIN)*(1+math.cos(math.pi*p))
    print(f"\nâ€” Epoch {epoch}/{EPOCHS} Â· STYLE_ALPHA = {style_alpha:.4f}")

    model.adapters.train()
    model.unet.down_blocks[3].train()
    model.unet.mid_block.train()

    train_loss = 0.0
    loader = DataLoader(train_ds, batch_size=BATCH_SIZE,
                        shuffle=True, drop_last=True, num_workers=4,
                        generator=torch.Generator().manual_seed(0))

    for ct, st in loader:
        ct, st = ct.to(device), st.to(device);  B = ct.size(0)

        # ---- noised latents ------------------------------------------------
        with torch.no_grad(), autocast(dtype=torch.float16):
            lat = model.pipe.vae.encode((ct*2-1)).latent_dist.sample()
            lat = lat * model.pipe.vae.config.scaling_factor
        t     = torch.randint(0, 1000, (B,), device=device)
        noise = torch.randn_like(lat)
        noisy = sched.add_noise(lat, noise, t).float()

        # ---- style map -----------------------------------------------------
        with torch.no_grad():
            s_map = model.cond(ct.float(), st.float())
        model._style = (style_alpha * _norm(s_map)).to(torch.float16)

        # ---- forward / backward -------------------------------------------
        optim.zero_grad(set_to_none=True)
        with autocast(dtype=torch.float16):
            pred = model.unet(noisy.to(torch.float16), t,
                              encoder_hidden_states=empty_emb.repeat(B,1,1)).sample
            loss = F.mse_loss(pred.float(), noise)

        scaler.scale(loss).backward()
        scaler.unscale_(optim)                         # â† removed allow_fp16
        nn.utils.clip_grad_norm_(optim_params, GRAD_CLIP_NORM)
        scaler.step(optim); scaler.update()

        model._style = None
        train_loss  += loss.item()

    train_loss /= len(loader)
    print(f"   train L2Â =Â {train_loss:.4f}")

    # ---- checkpoint -------------------------------------------------------
    torch.save(
        {"epoch": epoch,
         "adapters": model.adapters.state_dict(),
         "unet_d3":  model.unet.down_blocks[3].state_dict(),
         "unet_mid": model.unet.mid_block.state_dict(),
         "optim":    optim.state_dict()},
        f"{ckpt_dir}/epoch_{epoch:02d}.pt"
    )

    gc.collect(); torch.cuda.empty_cache()

print("\nğŸ extended fineâ€‘tuning finished.")


