# Cell 21 (REWRITE) Â· training loop with live FID + LPIPS (dtype fix)
import math
import time
import gc
import torch
import torch.nn.functional as F
from torch.cuda.amp import GradScaler, autocast
from torchmetrics.image.fid import FrechetInceptionDistance
import lpips
import torchvision.transforms.functional as TF

# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
# Assumes these are already defined:
#   model, device, train_loader, full_dataset,
#   resize_299, crop_299, EPOCHS, LR, STYLE_ALPHA,
#   sched, OUT_DIR, BEST_CKPT, GRAD_CLIP
# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€

# 0) prepare constant empty-prompt embedding (half, detached)
with torch.no_grad():
    tok_ids   = model.pipe.tokenizer("", return_tensors="pt").input_ids.to(device)
    EMPTY_EMB = model.pipe.text_encoder(tok_ids)[0].to(torch.float16).detach()
print(f"âœ… EMPTY_EMB ready: {EMPTY_EMB.shape}")

# metrics
fid_metric   = FrechetInceptionDistance(feature=2048).to(device)
lpips_metric = lpips.LPIPS(net='vgg').to(device)

best_fid = math.inf
start    = time.time()

for epoch in range(1, EPOCHS + 1):
    # â”€â”€â”€ TRAIN PASS (adapters in fp32) â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    # ensure adapters are fp32 for stable gradient/scaler behavior
    for i, adpt in enumerate(model.adapters):
        model.adapters[i] = adpt.to(device, torch.float32)

    optim = torch.optim.Adam(model.adapters.parameters(), lr=LR)
    scaler = GradScaler()

    model.adapters.train()
    train_loss = 0.0

    for ct, st in train_loader:
        ct, st = ct.to(device), st.to(device)
        B = ct.size(0)

        # encode + noise
        with torch.no_grad(), autocast(dtype=torch.float16):
            lat = model.pipe.vae.encode((ct * 2 - 1)).latent_dist.sample()
            lat = lat * model.pipe.vae.config.scaling_factor

        t     = torch.randint(0, 1000, (B,), device=device)
        noise = torch.randn_like(lat)
        noisy = sched.add_noise(lat, noise, t).float()

        # build style map
        with torch.no_grad():
            s_map = model.cond(ct.float(), st.float())
        norm_map       = (s_map - s_map.mean()) / (s_map.std() + 1e-3)
        model._style   = (STYLE_ALPHA * norm_map).half()

        optim.zero_grad(set_to_none=True)
        with autocast(dtype=torch.float16):
            pred = model.unet(
                noisy.half(),
                t,
                encoder_hidden_states=EMPTY_EMB.repeat(B,1,1)
            ).sample
            loss = F.mse_loss(pred.float(), noise)

        scaler.scale(loss).backward()
        scaler.unscale_(optim)
        torch.nn.utils.clip_grad_norm_(model.adapters.parameters(), GRAD_CLIP)
        scaler.step(optim)
        scaler.update()

        model._style = None
        train_loss  += loss.item()

    train_loss /= len(train_loader)

    # â”€â”€â”€ VALIDATION PASS (adapters in fp16) â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    # FID needs reset; LPIPS weâ€™ll average manually
    fid_metric.reset()
    lpips_vals = []

    # cast adapters â†’ half so conv bias & weight match input dtypes
    for i, adpt in enumerate(model.adapters):
        model.adapters[i] = adpt.to(device, torch.float16)

    model.adapters.eval()
    with torch.no_grad():
        # a) fake images
        for i in range(100):
            ct, st = full_dataset[i]
            out = model.generate(
                ct.unsqueeze(0).to(device),
                st.unsqueeze(0).to(device),
                steps=20,
                guidance=1.0,
                keep=0.8
            )[0]

            # update FID
            img_fid = crop_299(resize_299(out))
            t_fid   = TF.pil_to_tensor(img_fid)
            fid_metric.update(t_fid.unsqueeze(0).to(device), real=False)

            # compute LPIPS
            lpips_vals.append(
                lpips_metric(
                    TF.to_tensor(out).unsqueeze(0).to(device),
                    (ct.unsqueeze(0).to(device) * 0.5 + 0.5)
                ).item()
            )

        # b) real images
        for i in range(100):
            ct, _ = full_dataset[i]
            pil    = TF.to_pil_image(ct * 0.5 + 0.5)
            t_real = TF.pil_to_tensor(pil)
            fid_metric.update(t_real.unsqueeze(0).to(device), real=True)

    fid_val   = fid_metric.compute().item()
    lpips_val = sum(lpips_vals) / len(lpips_vals)

    # â”€â”€â”€ LOG & CHECKPOINT â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    elapsed = (time.time() - start) / 60
    print(f"[{epoch:02d}/{EPOCHS}] "
          f"train_loss={train_loss:.4f} | "
          f"FID={fid_val:.1f} | LPIPS={lpips_val:.3f} | "
          f"{elapsed:.1f} min")

    torch.save({
        "epoch":    epoch,
        "adapters": model.adapters.state_dict(),
        "fid":      fid_val,
        "lpips":    lpips_val
    }, f"{OUT_DIR}/epoch_{epoch:02d}.pt")

    if fid_val < best_fid:
        best_fid = fid_val
        torch.save(model.adapters.state_dict(), BEST_CKPT)
        print(f"  ğŸ”– new best FID â†’ saved adapters to {BEST_CKPT}")

    gc.collect()
    torch.cuda.empty_cache()

print("ğŸ finished fine-tuning")


