# Cell 22 Â· reload best adapters & quick gallery (fixed variable name)

import random
from PIL import Image
import torch
from torchvision.utils import make_grid
from torchvision.transforms.functional import to_tensor

# 1) reload the adapters that got best FID
best_adapters = torch.load(BEST_CKPT, map_location="cpu")
model.adapters.load_state_dict(best_adapters, strict=True)

# 2) back to pure fp16 everywhere
model = fix_model_dtypes(model, torch.float16)

# 3) set actual models to eval()
model.pipe.unet.eval()
model.pipe.vae.eval()
for ad in model.adapters:
    ad.eval()

# 4) sample 6 random (content, style), generate stylizations
idxs = random.sample(range(len(full_dataset)), 6)
rows = []
with torch.no_grad():
    for idx in idxs:
        ct, st = full_dataset[idx]

        # generate
        out = model.generate(
            ct.unsqueeze(0).to(device),
            st.unsqueeze(0).to(device),
            steps=40, guidance=1.0, keep=0.9
        )[0]

        # normalize tensors from [-1,1] â†’ [0,1]
        ct_norm = ct * 0.5 + 0.5
        st_norm = st * 0.5 + 0.5
        out_t   = to_tensor(out)   # PIL â†’ [0,1] tensor

        rows += [ct_norm, st_norm, out_t]

# 5) pack into a grid and save
