# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ CONFIG â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
# (tweak these as you like)
EPOCHS      = 30
LR          = 5e-5
GRAD_CLIP   = 0.5
STYLE_ALPHA = 0.02
STEPS       = 20
GUIDANCE    = 1.0
KEEP        = 0.90
N_FID       = 100               # how many for FID / LPIPS
OUT_DIR     = "checkpoints_full"
BEST_CKPT   = os.path.join(OUT_DIR, "best_adapters.pt")
os.makedirs(OUT_DIR, exist_ok=True)

DEVICE      = torch.device("cuda" if torch.cuda.is_available() else "cpu")

# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ PREPARE â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
# constant empty prompt embedding (fp16, detached)
with torch.no_grad():
    tok_ids   = model.pipe.tokenizer("", return_tensors="pt").input_ids.to(DEVICE)
    EMPTY_EMB = model.pipe.text_encoder(tok_ids)[0].to(torch.float16).detach()
print("âœ… EMPTY_EMB ready:", EMPTY_EMB.shape)

# metrics & scheduler
fid_metric   = FrechetInceptionDistance(feature=2048).to(DEVICE)
lpips_metric = lpips.LPIPS(net='vgg').to(DEVICE)
scheduler    = DDPMScheduler(num_train_timesteps=1000,
                            beta_schedule="squaredcos_cap_v2")

best_fid = float("inf")
start    = time.time()

# â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ TRAIN / VALID LOOP â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
for epoch in range(1, EPOCHS+1):
    # â”€â”€â”€ TRAIN PASS: adapters (and optionally mid/down3) in fp32 â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    for ad in model.adapters:
        ad.to(DEVICE, torch.float32)
    # if youâ€™re also fine-tuning down_blocks[3] + mid_block, cast those too:
    if hasattr(model.unet.down_blocks[3], "to"):
        model.unet.down_blocks[3].to(torch.float32)
        model.unet.mid_block.to(torch.float32)

    optimizer = torch.optim.Adam(model.adapters.parameters(), lr=LR)
    scaler    = GradScaler()
    model.adapters.train()
    train_loss = 0.0

    for ct, st in train_loader:
        ct, st = ct.to(DEVICE), st.to(DEVICE)
        B      = ct.shape[0]

        # encode â†’ latent
        with torch.no_grad(), autocast("cuda", dtype=torch.float16):
            post = model.pipe.vae.encode((ct*2 - 1).to(torch.float16))
            lat  = post.latent_dist.sample() * model.pipe.vae.config.scaling_factor

        # sample t & noise
        t     = torch.randint(0, 1000, (B,), device=DEVICE)
        noise = torch.randn_like(lat)
        noisy = scheduler.add_noise(lat.float(), noise, t).float()

        # build FFT map
        with torch.no_grad():
            fmap = model.cond(ct.float(), st.float())
        norm_map     = (fmap - fmap.mean())/(fmap.std() + 1e-5)
        model._style = (STYLE_ALPHA * norm_map).half()

        optimizer.zero_grad()
        with autocast("cuda", dtype=torch.float16):
            pred = model.unet(noisy.half(), t,
                              encoder_hidden_states=EMPTY_EMB.repeat(B,1,1)
                             ).sample
            loss = F.mse_loss(pred.float(), noise)

        scaler.scale(loss).backward()
        scaler.unscale_(optimizer)
        torch.nn.utils.clip_grad_norm_(model.adapters.parameters(), GRAD_CLIP)
        scaler.step(optimizer); scaler.update()

        model._style = None
        train_loss  += loss.item()
        torch.cuda.empty_cache()

    train_loss /= len(train_loader)

    # â”€â”€â”€ CAST EVERYTHING BACK TO FP16 FOR INFERENCE â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    model = fix_model_dtypes(model, torch.float16)

    # â”€â”€â”€ VALIDATION PASS: compute FID & LPIPS â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    fid_metric.reset()
    lpips_vals = []
    model.adapters.eval()

    with torch.no_grad():
        # fake
        for i in range(N_FID):
            ct, st = full_dataset[i]
            out = model.generate(
                ct.unsqueeze(0).to(DEVICE),
                st.unsqueeze(0).to(DEVICE),
                steps=STEPS, guidance=GUIDANCE, keep=KEEP
            )[0]

            # FID
            img_f = CenterCrop(299)(Resize(299, antialias=True)(out))
            fid_metric.update(pil_to_tensor(img_f).unsqueeze(0).to(DEVICE), real=False)
            # LPIPS
            lpips_vals.append(
                lpips_metric(
                    pil_to_tensor(out).unsqueeze(0).to(DEVICE),
                    (ct.unsqueeze(0)*0.5+0.5).to(DEVICE)
                ).item()
            )

        # real
        for i in range(N_FID):
            ct, _ = full_dataset[i]
            real_img = to_pil_image(ct*0.5 + 0.5)
            fid_metric.update(pil_to_tensor(real_img).unsqueeze(0).to(DEVICE), real=True)

    fid_val   = fid_metric.compute().item()
    lpips_val = sum(lpips_vals) / len(lpips_vals)
    elapsed   = (time.time() - start)/60

    print(f"[Epoch {epoch:02d}/{EPOCHS}] "
          f"train_loss={train_loss:.4f} | "
          f"FID={fid_val:.1f} | LPIPS={lpips_val:.3f} | "
          f"{elapsed:.1f} min")

    # â”€â”€â”€ checkpoint adapters + bestâ€soâ€far â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    ckpt_path = os.path.join(OUT_DIR, f"epoch_{epoch:02d}.pt")
    torch.save({
        "epoch":    epoch,
        "adapters": model.adapters.state_dict(),
        "fid":      fid_val,
        "lpips":    lpips_val
    }, ckpt_path)

    if fid_val < best_fid:
        best_fid = fid_val
        torch.save(model.adapters.state_dict(), BEST_CKPT)
        print(f"  ğŸ”– new best FID â†’ saved adapters to {BEST_CKPT}")

    gc.collect(); torch.cuda.empty_cache()

print("ğŸ Fully fine-tuned!")


